(function($){$.ui.autocomplete.wiquery={};$.ui.autocomplete.wiquery.closeEvent=function(ui,hiddenId){var val=$(ui).attr("value");var data=$(ui).data('autocomplete.selected');if(val==undefined||val.length<=0){$(ui).data('autocomplete.selected',null);}else if(data==undefined){var find=null;var source=$(ui).autocomplete('option','source');$.each(source,function(index,value){if(value.label==val){find=value;return false;}});$(ui).data('autocomplete.selected',find);}
data=$(ui).data('autocomplete.selected');$('#'+hiddenId).attr('value',data==undefined?'':data.valueId);};$.ui.autocomplete.wiquery.selectEvent=function(ui,hiddenId){$('#'+hiddenId).attr('value',ui.item.valueId);$(ui).data('autocomplete.selected',ui.item);};})(jQuery);